content:
É vergonhoso...

1. Falta de Estrutura;

2. Falta de Medicamentos;

3. Falta Educação;

Vamos voltar ao tempo dos Curandeiros?
Os médicos Importados vão fazer uso de plantas?
Onde?

Sem falar dos salários...
Quanto o Governo de Seu País irá repassar?


ACORDAR BRASIL – PRIORIDADE NO PAÍS É VIDA, SAÚDE E EDUCAÇÃO!
